class SingUpModel {  SingUpModel({    this.phone,    this.password,    this.displayName,    this.experienceYears,    this.address,    this.level,  });  SingUpModel.fromJson(dynamic json) {    phone = json['phone'];    password = json['password'];    displayName = json['displayName'];    experienceYears = json['experienceYears'];    address = json['address'];    level = json['level'];  }  String? phone;  String? password;  String? displayName;  num? experienceYears;  String? address;  String? level;  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    map['phone'] = phone;    map['password'] = password;    map['displayName'] = displayName;    map['experienceYears'] = experienceYears;    map['address'] = address;    map['level'] = level;    return map;  }}